import styled from "styled-components";

const ButtonSecondary = styled.TouchableOpacity`
  height: 40px;
  width: 270px;
  border-radius: 10px;
  display: flex;
  justify-content: center;
  align-items: center;
  margin: 5px 0;
  border: 1px solid #1da1f2;
  color: ${(props) => `${props.theme.colors.primary}`};
`;

const ButtonSecondaryTitle = styled.Text`
  color: ${(props) => `${props.theme.colors.primary}`};
  font-size: 15px;
`;
export { ButtonSecondary, ButtonSecondaryTitle };
